It’s been exactly a year since we went into lockdown & reflecting on the year gone by I can safely say that we really tried to take the negatives & turn them to positives.There were times when we were questioning the foundations of work, our brand ethos & had many ups & downs like so many of us around, I remember very clearly breaking down 2 months into the lockdown wanting to shut shop. However, the pandemic forced us to breathe, take a step back & introspect giving life to skills that we didn’t know existed.

From playing Muse for my label, to auditioning for a role in a sitcom & acting as a Cop. From doing our first Digital show @lakmefashionwk to creating a dress out of Wrapping Paper. From getting a shout out from @priyankachopra in her #supportsmallbiz campaign to winning 2nd place in an international competition with @stylepr Los Angeles, this year has been one of re-invention and individual growth. We founded the @savingtheartist campaign along with 14 designers to raise funds for migrant workers & kaarigars & also to help victims of domestic violence via ngo @snehamumbai_official. 

Watch this video to see how we tried to make the most of 2020.
It was a very tough year for us all, the undercurrents of which can still be felt, but here’s to a safe and positive 2021 to everyone, One full of love & compassion.
There were so many of you that became a part of this process & we feel humbled to have shared this journey with you.

A toast to new beginnings 🧿 

