Woke up this morning , checked the  checklist:
Social responsibility through charity : Done ✅

Social distancing : Done ✅

Socialising : Digitally with my Fashion Family : SO NOT DONE! ❎

Next thing I know We’re calling up fashionistas from all over the world : Designers, Bloggers, Stylists,  Make-up Artists ,Influencers...to get together and uplift each other’s spirits with the 
#fashionfromhomechallenge 
But what to wear? 
And from there, the idea was born, to come together in Cyber space, to Connect & to Create! Our version of ‘Style in the time of Quarantine’ 
Using whatever was available at home , bedsheets, towels,  pillowcases even wrapping paper , to create an outfit that is  red carpet ready! 🧵🧶👚🧥👗👘👠🧤🕶️👜💍👑💃 From Dubai, to Mumbai, to Delhi, to Punjab to London & Hong Kong these amazing women have come together and shown such spunk and sass in a time of self-isolation.

As Robbie Williams would say...🎶🎵Let meeeeee  Entertain You!!!🎵🎶🎶 I hope you enjoy this video Girls
Let’s always be there for each other ❤️ Seriously love each and everyone one of you for making this super unnerving time such fun.SHEREEN you were my Rock throughout this Thankyou So much ❤️❤️ #fashionfrommhomechallenge

